import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
      <form>
        <label>
          Nom :
          <input type="text" name="name" />
        </label>
      <input type="submit" value="Envoyer" />
      </form>
      </body>
    </div>
  );
}

export default App;
